import { useState } from 'react'
import {Box, styled} from '@mui/material'

const GameBoard = styled(Box)({
  width: 300,
  height: 300,
  backgroundColor: 'grey',
})

function App() {

  return (
    <GameBoard 
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justifyContent="center"
    />
  )
}

export default App;
